【商品説明】<br>口臭の最大の原因である歯周病菌を長時間殺菌し、口臭、歯周病を予防します。<br>使用方法用途など：<BR>適用量１０ｍｌ（キャップ半分）をお口に含み、約２０秒よく行き渡らせた後、ブラッシングしてください。使用後、水ですすぐ必要はありませんが、気になる場合は軽くすすいでください。水ですすいでも長時間効果を発揮します。<br><br>成分：<BR>溶剤：エタノール、濃グリセリン／香味剤：香料（クールミント）、サッカリンＮａ／可溶化剤：ＰＯＥ硬化ヒマシ油／薬用成分：塩化セチルピジニウム（殺菌剤ＣＰＣ）、グリチルリチン酸２Ｋ（抗炎症剤ＧＫ２）、トリクロサン（殺菌剤ＴＣ）／ｐＨ調整剤：クエン酸Ｎａ、無水クエン酸／清掃助剤：ヤシ油脂肪酸アシルアルギニンエチル・ＤＬ－ＰＣＡ塩<br>使用上の注意：<BR>内服液ではありません、発疹、かゆみ等が現れた場合は使用を中止し、医師に相談する。<br>保管および取扱い上の注意：<BR>乳幼児の手の届かない所に保管する。<br>商品区分：医薬部外品<br>問い合わせ先：<BR>０１２０－００８２４１<br>原産国：日本<br>商品サイズ：96×218×75<BR><br>JANコード：4901616010161<BR>cs：12<BR><br>使用方法用途など：適用量１０ｍｌ（キャップ半分）をお口に含み、約２０秒よく行き渡らせた後、ブラッシングしてください。使用後、水ですすぐ必要はありませんが、気になる場合は軽くすすいでください。水ですすいでも長時間効果を発揮します。<br><br>成分：溶剤：エタノール、濃グリセリン／香味剤：香料（クールミント）、サッカリンＮａ／可溶化剤：ＰＯＥ硬化ヒマシ油／薬用成分：塩化セチルピジニウム（殺菌剤ＣＰＣ）、グリチルリチン酸２Ｋ（抗炎症剤ＧＫ２）、トリクロサン（殺菌剤ＴＣ）／ｐＨ調整剤：クエン酸Ｎａ、無水クエン酸／清掃助剤：ヤシ油脂肪酸アシルアルギニンエチル・ＤＬ－ＰＣＡ塩<br>使用上の注意：内服液ではありません、発疹、かゆみ等が現れた場合は使用を中止し、医師に相談する。<br>保管および取扱い上の注意：乳幼児の手の届かない所に保管する。<br>商品区分：医薬部外品<br>問い合わせ先：０１２０－００８２４１<br>原産国：日本<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
