【商品説明】<br>爽快な清涼感あふれるクリアな味です。刺激が強いのは苦手という方にお勧めです。<br>使用方法用途など：<BR>・適量約10ml（キャップ中央の線までの量）を口に含んで約30秒ほどすすいでから吐き出してください。\n・本品はハミガキではありませんので日常の歯みがきは行ってください。<br><br>成分：<BR>基材/水、湿潤剤/グリセリン・プロパンジオール、可溶化剤/ミリスチン酸ポリグリセリル-10、甘味剤/キシリトール、保湿剤/アルギン酸Na、洗浄剤/ミリストイルグルタミン酸Na・キラヤ樹皮エキス・デキストリン・アロエベラ葉エキス・チャボアザミ根エキス・クスノキ葉エキス・マンナノキ種子エキス・ミルラエキス・サフラン柱頭エキス・ショウズク種子エキス・セイヨウカノコソウ根エキス、保存剤/ポドカルプストタラ木エキス・ウィンターセボリー油・タチジャコウ花/葉油、pH調整剤/水酸化Na、着香剤/ベルガモット果皮油・レモ<br>使用上の注意：<BR>●内服液ではありませんので、飲まないでください。\n●口内に傷等の異常があるときは使用しないでください。\n●口内の異常、発疹などのアレルギー、ぜんそくなどの症状が出たら使用を中止し、医師に相談してください（受信の際は商品を持参してください）。\n●目に入らないようご注意ください。万一入った場合は、すぐに水かぬるま湯で充分洗い流してください。\n●直射日光、高温多湿、乳幼児の手の届くところに保管しないでください。\n●開封後は速やかにご使用ください。\n●天然成分を使用しているため香りや色調に差が生じるこ<br>保管保存方法：<BR>●直射日光、高温多湿、乳幼児の手の届くところに保管しないでください。<br>問い合わせ先：<BR>ＮＳファーファジャパン株式会社　〒１３０ー００２４　　　東京都墨田区菊川３ー２１ー８お客様相談室　でんわ０３ー５６６９ー１２３０<br>原産国：日本<br>ブランド：<BR>商品サイズ：92×194×58<br>JANコード：4902135128269<BR>cs：12<BR>商品カテゴリ： バス用品・洗面用品 ＞ オーラル ＞ マウスウォッシュ ＞ 基本機能　(000200)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
