「薬用システマ ハグキプラス デンタルリンス 900ml」は、おとろえてきた歯ぐき細胞を活性化して、歯周病を防ぐ薬用デンタルリンスです。組織修復作用(アラントイン)で歯ぐき細胞を活性化して、歯ぐき組織を修復。抗炎症作用(トラネキサム酸)で歯ぐきのハレ・出血を抑えます。さらに、浸透殺菌成分(IPMP(イソプロピルメチルフェノール))配合で、歯ぐき組織を壊す歯周ポケットの奥の歯周病菌を浸透殺菌します。薬用成分が歯ぐきにどどまる処方。歯ぐきにやさしい低刺激タイプ(ノンアルコールタイプ)。医薬部外品。<br><br>使用上の注意<br>●使用方法を守る。<br>●内服液ではありません。<br>●口中に異常があるときは使用しない。<br>●発疹などの異常が現れたときは使用を中止し、商品を持参し、医師に相談する。<br>●乳幼児の手の届くところに置かない。歯科医院で歯の定期健診を受けましょう。<br><br>成分<br>湿潤剤：グリセリン、PG、DPG<br>薬用成分：PEG-8、イソプロピルメチルフェノール(IPMP)、トラネキサム酸、アラントイン<br>香味剤：香料(メディカルハーブミントタイプ)、キシリトール<br>可溶化剤：ラウロイルメチルタウリンNa、POE(60)硬化ヒマシ油<br>保存剤：安息香酸Na、パラベン<br>pH調整剤：クエン酸Na、クエン酸<br>基剤：トリ(カプリル・カプリン酸)グリセリル<br>乳化剤：POE硬化ヒマシ油<br><br>原産国：日本<br>お問い合わせ先<br>ライオン株式会社<br>0120-556-913<br>区分：医薬部外品<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
